import HeaderCatalog from "../HeaderCatalog/header_catalog";
import FilterCatalog from "../FilterCatalog/filter_catalog";
import BottomCatalog from "../BottomCatalog/bottom_catalog";
import Footer from "../Footer/footer";
import React from "react";
import ProductItem from "../ProductItem/product_item";

function Catalog() {
    const products = [
        { id: 1, title: 'TRHD-533', price: 10.00 },
        { id: 2, title: 'GYUJNE-222', price: 8.00 },
        { id: 3, title: '76DJHG', price: 2.00 },
        { id: 4, title: 'GYEBGEY', price: 45.00 },
        { id: 5, title: 'GVWUU DHU', price: 55.00 },
        { id: 6, title: '20-HGFff', price: 67.00 },
    ];
    return (
        <div>
            <div>
                <HeaderCatalog/>
                <FilterCatalog/>
                <div className="product-list">
                    {products.map((product) => (
                        <ProductItem key={product.id} product={product} />
                    ))}
                </div>
                <BottomCatalog/>
                <Footer/>
            </div>
        </div>
    );
}

export default Catalog;
